(3, 1, '2020-08-31 12:47:17', '2020-08-31 10:47:17', '<!-- wp:heading -->\n<h2>Wer wir sind</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Die Adresse unserer Website ist: http://localhost:8888/mulke-topfkraeute.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Welche personenbezogenen Daten wir sammeln und warum wir sie sammeln</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Kommentare</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Wenn Besucher Kommentare auf der Website schreiben, sammeln wir die Daten, die im Kommentar-Formular angezeigt werden, außerdem die IP-Adresse des Besuchers und den User-Agent-String (damit wird der Browser identifiziert), um die Erkennung von Spam zu unterstützen.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Aus deiner E-Mail-Adresse kann eine anonymisierte Zeichenfolge erstellt (auch Hash genannt) und dem Gravatar-Dienst übergeben werden, um zu prüfen, ob du diesen benutzt. Die Datenschutzerklärung des Gravatar-Dienstes findest du hier: https://automattic.com/privacy/. Nachdem dein Kommentar freigegeben wurde, ist dein Profilbild öffentlich im Kontext deines Kommentars sichtbar.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Medien</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Wenn du ein registrierter Benutzer bist und Fotos auf diese Website lädst, solltest du vermeiden, Fotos mit einem EXIF-GPS-Standort hochzuladen. Besucher dieser Website könnten Fotos, die auf dieser Website gespeichert sind, herunterladen und deren Standort-Informationen extrahieren.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Kontaktformulare</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Cookies</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Wenn du einen Kommentar auf unserer Website schreibst, kann das eine Einwilligung sein, deinen Namen, E-Mail-Adresse und Website in Cookies zu speichern. Dies ist eine Komfortfunktion, damit du nicht, wenn du einen weiteren Kommentar schreibst, all diese Daten erneut eingeben musst. Diese Cookies werden ein Jahr lang gespeichert.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Falls du ein Konto hast und dich auf dieser Website anmeldest, werden wir ein temporäres Cookie setzen, um festzustellen, ob dein Browser Cookies akzeptiert. Dieses Cookie enthält keine personenbezogenen Daten und wird verworfen, wenn du deinen Browser schließt.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Wenn du dich anmeldest, werden wir einige Cookies einrichten, um deine Anmeldeinformationen und Anzeigeoptionen zu speichern. Anmelde-Cookies verfallen nach zwei Tagen und Cookies für die Anzeigeoptionen nach einem Jahr. Falls du bei der Anmeldung „Angemeldet bleiben“ auswählst, wird deine Anmeldung zwei Wochen lang aufrechterhalten. Mit der Abmeldung aus deinem Konto werden die Anmelde-Cookies gelöscht.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Wenn du einen Artikel bearbeitest oder veröffentlichst, wird ein zusätzlicher Cookie in deinem Browser gespeichert. Dieser Cookie enthält keine personenbezogenen Daten und verweist nur auf die Beitrags-ID des Artikels, den du gerade bearbeitet hast. Der Cookie verfällt nach einem Tag.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Eingebettete Inhalte von anderen Websites</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Beiträge auf dieser Website können eingebettete Inhalte beinhalten (z.&nbsp;B. Videos, Bilder, Beiträge etc.). Eingebettete Inhalte von anderen Websites verhalten sich exakt so, als ob der Besucher die andere Website besucht hätte.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Diese Websites können Daten über dich sammeln, Cookies benutzen, zusätzliche Tracking-Dienste von Dritten einbetten und deine Interaktion mit diesem eingebetteten Inhalt aufzeichnen, inklusive deiner Interaktion mit dem eingebetteten Inhalt, falls du ein Konto hast und auf dieser Website angemeldet bist.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Mit wem wir deine Daten teilen</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Wir teilen keine personenbezogenen Daten mit Dritten.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Wie lange wir deine Daten speichern</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Wenn du einen Kommentar schreibst, wird dieser inklusive Metadaten zeitlich unbegrenzt gespeichert. Auf diese Art können wir Folgekommentare automatisch erkennen und freigeben, anstelle sie in einer Moderations-Warteschlange festzuhalten.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Für Benutzer, die sich auf unserer Website registrieren, speichern wir zusätzlich die persönlichen Informationen, die sie in ihren Benutzerprofilen angeben. Alle Benutzer können jederzeit ihre persönlichen Informationen einsehen, verändern oder löschen (der Benutzername kann nicht verändert werden). Administratoren der Website können diese Informationen ebenfalls einsehen und verändern.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Welche Rechte du an deinen Daten hast</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Wenn du ein Konto auf dieser Website besitzt oder Kommentare geschrieben hast, kannst du einen Export deiner personenbezogenen Daten bei uns anfordern, inklusive aller Daten, die du uns mitgeteilt hast. Darüber hinaus kannst du die Löschung aller personenbezogenen Daten, die wir von dir gespeichert haben, anfordern. Dies umfasst nicht die Daten, die wir aufgrund administrativer, rechtlicher oder sicherheitsrelevanter Notwendigkeiten aufbewahren müssen.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Wohin wir deine Daten senden</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Besucher-Kommentare könnten von einem automatisierten Dienst zur Spam-Erkennung untersucht werden.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Deine Kontakt-Informationen</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Von Benutzern des Kontaktformulares werden Name und E-Mail-Adresse gespeichert. Diese sind für die Empfänger der Nachricht, also die zuständigen Mitarbeiter der Mulke-Topfkräuter, einsehbar.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Wie wir deine Daten schützen</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Grundsätzlich haben nur die Administratoren dieser Seite Zugriff auf die von Ihnen angegeben Daten. Administratoren sind zum einen die aktuellen Vorstandsmitglieder des EuSaB e.V. sowie die mit der Betreuung dieser Seite beauftragten Mitarbeiter der Marketing Mittelrhein GbR. Nur diese Personen haben Zugriff auf die Daten, die über diese Seite verarbeitet werden.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dank einer SSL-Verschlüsselung dieser Website sind alle Daten, die Sie auf dieser Seite eintragen und gegebenenfalls an uns übermitteln vor dem Zugriff Dritter geschützt.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Weitere Informationen</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Welche Maßnahmen wir bei Datenschutzverletzungen anbieten</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Ihnen stehen bei Vorliegen der gesetzlichen Voraussetzungen folgende Rechte nach Art. 15 bis 20 DSGVO zu: Recht auf Auskunft, auf Berichtigung, auf Löschung, auf Einschränkung der Verarbeitung, auf Datenübertragbarkeit. Da Cookies die Daten pseudonymisieren und eine Identifizierung einer Person unmöglich macht, kommen die Art. 15 bis 20 aufgrund des Art. 11 DSGVO dafür nicht zur Anwendung. Außerdem steht Ihnen nach Art. 21 (1) DSGVO ein Widerspruchsrecht gegen die Verarbeitungen zu, die auf Art. 6 (1) f DSGVO beruhen. Unsererseits sind wir nach Art. 33 DSGVO verpflichtet, Verletzungen des Schutzes personenbezogener Daten unverzüglich der Aufsichtsbehörde zu melden. Kontaktieren Sie uns auf Wunsch. Die Kontaktdaten finden Sie in unserem Impressum.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Von welchen Drittanbietern wir Daten erhalten</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Es gibt keine Drittanbieter, von denen wir Daten erhalten.</p>\n<!-- /wp:paragraph -->', 'Datenschutzerklärung', '', 'publish', 'closed', 'closed', '', 'datenschutzerklaerung', '', '', '2020-11-16 08:39:05', '2020-11-16 07:39:05', '', 0, 'http://localhost:8888/mulke-topfkraeute/?page_id=3', 3, 'page', '', 0),
(23, 1, '2020-09-01 22:16:14', '2020-09-01 20:16:14', '<!-- wp:paragraph -->\n<p>Dies ist eine Beispiel-Seite. Sie unterscheidet sich von Beiträgen, da sie stets an derselben Stelle bleibt und (bei den meisten Themes) in der Website-Navigation angezeigt wird. Die meisten starten mit einem Impressum, der Datenschutzerklärung oder einer „Über&nbsp;uns“-Seite, um sich potenziellen Besuchern der Website vorzustellen. Dort könnte zum Beispiel stehen:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hallo! Tagsüber arbeite ich als Fahrradkurier, nachts bin ich ein aufstrebender Schauspieler und dies hier ist meine Website. Ich lebe in Berlin, habe einen großen Hund namens Jack, mag Piña Coladas, jedoch weniger (ohne Schirm) im Regen stehen gelassen zu werden.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...oder so etwas wie das hier:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Das Unternehmen XYZ wurde 1971 gegründet und versorgt die Öffentlichkeit seither mit qualitativ hochwertigen Produkten. An seinem Standort in einer kleinen Großstadt beschäftigt der Betrieb über 2.000 Menschen und unterstützt die Stadtbewohner in vielfacher Hinsicht.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Als neuer WordPress-Benutzer solltest du <a href=\"http://localhost:8888/mulke-topfkraeute/wp-admin/\">dein Dashboard</a> aufrufen, um diese Seite zu löschen und neue Seiten und Beiträge für deine Website erstellen. Viel Spaß!</p>\n<!-- /wp:paragraph -->', 'Beispiel-Seite', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-09-01 22:16:14', '2020-09-01 20:16:14', '', 2, 'http://localhost:8888/mulke-topfkraeute/2020/09/01/2-revision-v1/', 0, 'revision', '', 0),
(25, 1, '2020-09-04 11:57:48', '2020-09-04 09:57:48', '<!-- wp:heading {\"align\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\">Willkommen bei Mulke Topfkräuter GmbH</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":149,\"sizeSlug\":\"large\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large\"><img src=\"http://localhost:8888/mulke-topfkraeute/wp-content/uploads/2020/11/logo-2.jpg\" alt=\"\" class=\"wp-image-149\"/><figcaption><em><span style=\"color:#62bb49\" class=\"has-inline-color\">Wir freuen uns, Sie auf unserer Homepage begrüßen zu dürfen.</span></em></figcaption></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>Wir sind Ihre Bio-Topfkräuter-Produktion im&nbsp;Rhein-Main-Gebiet.</strong></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>Nach dem Motto \"total genial-regional\"</strong></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>erzeugen wir mit größter Sorgfalt in unseren Gewächshäusern</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>auf ca. 14.000 qm Glasfläche, Bio-Topfkräuter für Ihre Fensterbank und</strong> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>Ihren Garten.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>Unser Gartenbaubetrieb wurde schon im Jahr 1904 gegründet, damals im Bezirk</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>Wiesbaden-Klarenthal.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>Im Jahre 1964 siedelte der Betrieb um in die Gemeinde Delkenheim.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>Hier enstanden auf 2,5 ha Eigenland neue Gewächshäuser.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>Heute besteht der Betrieb in der fünften Generation</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>und hat seine Ausrichtung auf die Erzeugung von Bio-Topfkräutern&nbsp;gelegt.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong><span style=\"color:#62bb49\" class=\"has-inline-color\">\"Weil Bio-einfach besser isst..&nbsp;&nbsp;\"&nbsp;</span></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Bei Ihrer virtuellen Streiftour können Sie sich einen Eindruck über unsere Produkte und dem Anbau von Topfkräutern verschaffen….</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:metaslider/slider {\"slideshowId\":279} -->\n<div class=\"alignnormal\">[metaslider id=279 cssclass=\"\"]</div>\n<!-- /wp:metaslider/slider -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>Neben den Bio-Topfkräutern,</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>beschäftigen wir uns auch mit der Ausbildung von jungen Menschen</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>im Beruf Gärtner/Gärtnerin und Gartenbauwerker /-werkerin.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>Die Ausbildung dauert drei Jahre und ist ein Einstieg in die \"grüne Branche\".</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>Gerne geben wir hier unser Wissen und die Liebe zur Natur mit auf Ihre Wege<em>.</em></strong></p>\n<!-- /wp:paragraph -->', 'Mulke Topfkräuter Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2020-11-20 17:59:36', '2020-11-20 16:59:36', '', 0, 'http://localhost:8888/mulke-topfkraeute/?page_id=25', 0, 'page', '', 0),
