(913, 1, '2020-11-20 18:13:15', '2020-11-20 17:13:15', '<!-- wp:paragraph -->\n<p><strong>Allgemeine Geschäftsbedingungen von Mulke Topfkräuter&nbsp;</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>Geltungsbereich</strong></li><li><strong>Vertragspartner</strong></li><li><strong>Vertragsschluss</strong></li><li><strong>Widerrufsrecht</strong></li><li><strong>Preise und Versandkosten</strong></li><li><strong>Lieferung</strong></li><li><strong>Zahlung</strong></li><li><strong>Eigentumsvorbehalt</strong></li><li><strong>Streitbeilegung</strong></li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><strong>Allgemeine Geschäftsbedingungen</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li><strong>Geltungsbereich<br></strong>Für alle Lieferungen der Mulke-Topfkräuter GmbH (www.mulke-topfkraeuter.de) an Verbraucher gelten diese Allgemeinen Geschäftsbedingungen (AGB).<br>Verbraucher ist jede natürliche Person, die ein Rechtsgeschäft zu einem Zwecke abschließt, der überwiegend weder ihrer gewerblichen noch ihrer selbstständigen beruflichen Tätigkeit zugerechnet werden kann.</li><li><strong>Vertragspartner<br></strong>Der Kaufvertrag kommt zustande mit der Mulke-Topfkräuter GmbH, Inhaber: Monika Mulke, Gärtnerei Taunusblick 1<br>65205 Wiesbaden</li><li><strong>Vertragsschluss</strong>&nbsp;<ul><li>Die Darstellung der Produkte im Online-Shop stellt kein rechtlich bindendes Angebot, sondern nur eine Aufforderung zur Bestellung dar.&nbsp;</li><li>Durch Anklicken des Buttons [Kaufen/kostenpflichtig bestellen] geben Sie eine verbindliche Bestellung der auf der Bestellseite aufgelisteten Waren ab. Ihr Kaufvertrag kommt zustande, wenn wir Ihre Bestellung durch eine Auftragsbestätigung per E-Mail unmittelbar nach dem Erhalt Ihrer Bestellung annehmen.</li></ul></li><li><strong>Widerrufsrecht</strong>&nbsp;<ul><li>Wenn Sie Verbraucher sind (also eine natürliche Person, die die Bestellung zu einem Zweck abgibt, der weder Ihrer gewerblichen oder selbständigen beruflichen Tätigkeit zugerechnet werden kann), steht Ihnen nach Maßgabe der gesetzlichen Bestimmungen ein Widerrufsrecht zu.</li><li>Machen Sie als Verbraucher von Ihrem Widerrufsrecht nach Ziffer 4.1 Gebrauch, so haben Sie die regelmäßigen Kosten der Rücksendung zu tragen.</li><li>Im Übrigen gelten für das Widerrufsrecht die Regelungen, die im Einzelnen wiedergegeben sind in der folgenden<br><br><strong>Widerrufsbelehrung¹<br><br>Widerrufsrecht<br><br>Sie haben das Recht, binnen vierzehn Tagen ohne Angabe von Gründen diesen Vertrag zu widerrufen.<br></strong><br><strong>Die Widerrufsfrist beträgt vierzehn Tage ab dem Tag an dem Sie oder ein von Ihnen benannter Dritter, der nicht der Beförderer ist, die Waren in Besitz genommen haben bzw. hat.</strong><br><br><strong>Um Ihr Widerrufsrecht auszuüben, müssen Sie uns [Name des Unternehmers, Anschrift und, soweit verfügbar Telefonnummer, Telefaxnummer und E-Mail Adresse eintragen] mittels einer eindeutigen Erklärung (zB ein mit der Post versandter Brief, Telefax oder E-Mail) über Ihren Entschluss, diesen Vertrag zu widerrufen, informieren. Sie können dafür das beigefügte Muster-Widerrufsformular verwenden, das jedoch nicht vorgeschrieben ist. Sie können das Muster- Widerrufsformular oder eine andere eindeutige Erklärung auch auf unserer Webseite (Internet-Adresse einfügen) elektronisch ausfüllen und übermitteln. Machen Sie von dieser Möglichkeit Gebrauch, so werden wir Ihnen unverzüglich (zB per E-Mail) eine Bestätigung über den Eingang eines solchen Widerrufs übermitteln.</strong><br><br><strong>Zur Wahrung der Widerrufsfrist reicht es aus, dass Sie die Mitteilung über die Ausübung des Widerrufsrechts vor Ablauf der Widerrufsfrist absenden.</strong><br><br><strong>Folgen des Widerrufs</strong><br><br><strong>Wenn Sie diesen Vertrag widerrufen, haben wir Ihnen alle Zahlungen, die wir von Ihnen erhalten haben, einschließlich der Lieferkosten (mit Ausnahme der zusätzlichen Kosten, die sich daraus ergeben, dass Sie eine andere Art der Lieferung als die von uns angebotene, günstigste Standardlieferung gewählt haben), unverzüglich und spätestens binnen vierzehn Tagen ab dem Tag zurückzuzahlen, an dem die Mitteilung über Ihren Widerruf dieses Vertrags bei uns eingegangen ist. Für diese Rückzahlung verwenden wir dasselbe Zahlungsmittel, das Sie bei der ursprünglichen Transaktion eingesetzt haben, es sei denn, mit Ihnen wurde ausdrücklich etwas anderes vereinbart; in keinem Fall werden Ihnen wegen dieser Rückzahlung Entgelte berechnet. Wir können die Rückzahlung verweigern, bis wir die Waren wieder zurückerhalten haben oder bis Sie den Nachweis erbracht haben, dass Sie die Waren zurückgesandt haben, je nachdem, welches der frühere Zeitpunkt ist.</strong><br><br><strong>Sie haben die Waren unverzüglich und in jedem Fall spätestens binnen vierzehn Tagen ab dem Tag, an dem Sie uns über den Widerruf dieses Vertrages unterrichten, an uns oder an (hier sind gegebenenfalls der Name und die Anschrift der von Ihnen zur Entgegennahme der Ware ermächtigten Person einzufügen) zurückzusenden oder zu übergeben. Die Frist ist gewahrt, wenn Sie die Waren vor Ablauf der Frist von vierzehn Tagen absenden.</strong><br><br><strong>Sie tragen die unmittelbaren Kosten der Rücksendung der Waren.</strong><br><br><strong>Sie müssen für einen etwaigen Wertverlust der Waren nur aufkommen, wenn dieser Wertverlust auf einen zur Prüfung der Beschaffenheit, Eigenschaften und Funktionsweise der Waren nicht notwendigen Umgang mit ihnen zurückzuführen ist.</strong><br><br><strong>- Ende der Widerrufsbelehrung -<br><br></strong>(<strong>¹</strong> Diese Widerrufsbelehrung gilt nicht für die getrennte Lieferung von Waren.)</li></ul></li><li><strong>Preise und Versandkosten</strong>&nbsp;<ul><li>Die auf den Produktseiten genannten Preise enthalten die gesetzliche Mehrwertsteuer und sonstige Preisbestandteile.&nbsp;</li><li>Zusätzlich zu den angegebenen Preisen berechnen wir für die Lieferung innerhalb Deutschlands pauschal 6,90 Euro pro Bestellung. Die Versandkosten werden Ihnen auf den Produktseiten, im Warenkorbsystem und auf der Bestellseite nochmals deutlich mitgeteilt.&nbsp;</li><li>Bei Zahlung per Nachnahme wird zusätzlich eine Gebühr in Höhe von 2.- Euro fällig, die der Zusteller vor Ort erhebt. Weitere Steuern oder Kosten fallen nicht an.</li></ul></li><li><strong>Lieferung</strong>&nbsp;<ul><li>Die Lieferung erfolgt nur innerhalb Deutschlands mit DHL.&nbsp;</li><li>Die Lieferzeit beträgt bis zu 3 Tage. Auf eventuell abweichende Lieferzeiten weisen wir auf der jeweiligen Produktseite hin.</li></ul></li><li><strong>Zahlung&nbsp;</strong><ul><li>Die Zahlung erfolgt per Paypal.</li></ul></li><li><strong>Eigentumsvorbehalt</strong>&nbsp;<ul><li>Bis zur vollständigen Zahlung bleibt die Ware unser Eigentum.</li></ul></li><li><strong>Streitbeilegung</strong>&nbsp;<ul><li>Die EU-Kommission hat eine Internetplattform zur Online-Beilegung von Streitigkeiten geschaffen. Die Plattform dient als Anlaufstelle zur außergerichtlichen Beilegung von Streitigkeiten betreffend vertragliche Verpflichtungen, die aus Online-Kaufverträgen erwachsen. Nähere Informationen sind unter dem folgenden Link verfügbar: http://ec.europa.eu/consumers/odr.Wir sind zur Beilegung von Streitigkeiten mit Verbrauchern zur Teilnahme an einem Streitbeilegungsverfahren vor einer Verbraucherschlichtungsstelle bereit oder gemäß XXX (Angabe der Rechtsnorm oder der vertraglichen Vereinbarung) verpflichtet. Die zuständige Verbraucherschlichtungsstelle ist: Universalschlichtungsstelle des Bundes Zentrum für Schlichtung e.V., Straßburger Straße 8, 77694 Kehl am Rhein, www.verbraucher-schlichter.de. Zur Beilegung der genannten Streitigkeiten werden wir in einem Streitbeilegungsverfahren vor dieser Stelle teilnehmen.<br><br>Alternativ:<br>Die EU-Kommission hat eine Internetplattform zur Online-Beilegung von Streitigkeiten geschaffen. Die Plattform dient als Anlaufstelle zur außergerichtlichen Beilegung von Streitigkeiten betreffend vertragliche Verpflichtungen, die aus Online-Kaufverträgen erwachsen. Nähere Informationen sind unter dem folgenden Link verfügbar: http://ec.europa.eu/consumers/odr. Zur Teilnahme an einem Streitbeilegungsverfahren vor einer Verbraucherschlichtungsstelle sind wir weder bereit noch verpflichtet.</li></ul></li></ul>\n<!-- /wp:list -->', 'AGB', '', 'inherit', 'closed', 'closed', '', '911-autosave-v1', '', '', '2020-11-20 18:13:15', '2020-11-20 17:13:15', '', 911, 'http://localhost:8888/mulke-topfkraeute/911-autosave-v1/', 0, 'revision', '', 0),
